import React from "react";
import "./Styles.css";
import Link from "react-router-dom";
function Nav() {
  return (
    <div className="container">
      <ul className="navUl">
        <Link to="/Home">
          <li>Home</li>
        </Link>
        <li>Menu</li>
        <li>Contact</li>
        <li>News</li>
      </ul>
    </div>
  );
}

export default Nav;
